import React, { useEffect, useState } from 'react'
import axios from 'axios'
const PlayerView = ({
    match: {
        params: { id },
    },
}) => {
    const [info, setInfo] = useState()
    useEffect(() => {
        axios
            .get(`https://jobs-xmmtw.ondigitalocean.app/player/${id}`)
            .then((res) => {
                setInfo(res.data)
            })
    })

    return <div>{info.name}</div>
}

export default PlayerView
